import {BrowserRouter,Routes,Route} from 'react-router-dom'
import Home from './pages/Home'
import navbar from './components/navbar';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <navbar/>
      <div className='pages'>
        <Routes>
        <Route
        path='/'
        element={<Home/>}>

        </Route>
      </Routes>
      </div>
      </BrowserRouter>

    </div>
  );
}

export default App;
